{
  "Court": "Judgment",
  "Summary": "The applicant, a Turkish national, was convicted for disseminating propaganda in favor of an illegal armed organization during a demonstration. She was sentenced to ten months' imprisonment, with the pronouncement of her conviction suspended on the condition that she did not commit another intentional offense for five years. The applicant claims violations of her rights under Articles 6, 10, and 11 of the European Convention on Human Rights.",
